import ListItem from './ListItem';
import {
  ArrowBackIosOutlined,
  ArrowForwardIosOutlined,
} from '@material-ui/icons';
import { ListContainer, StyledList } from './styles/List.styled';

const List = () => {
  return (
    <StyledList>
      <h2>계속 시청하기</h2>

      <div>
        <ArrowBackIosOutlined />
        <ListContainer>
          <ListItem />
          <ListItem />
          <ListItem />
          <ListItem />
          <ListItem />
          <ListItem />
          <ListItem />
        </ListContainer>
        <ArrowForwardIosOutlined />
      </div>
    </StyledList>
  );
};

export default List;
